  `error_message` varchar(255) DEFAULT NULL,
  `transaction_id` varchar(255) DEFAULT NULL,
  `cart` text,
  `cart_id` int(10) DEFAULT NULL,
  PRIMARY KEY (`entry_id`),
  KEY `session_id` (`session_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

