_fields" class=''form-horizontal''>\r\n\r\n 							<div class="control-group">\r\n								<label class="control-label" for="from">\r\n								Your Email:\r\n								</label>\r\n								<div class="controls">\r\n									<div class="input-prepend">\r\n										<span class="add-on"><i class="icon-envelope"></i></span>\r\n										<input type="text" id="from" name="from"  value="{member_email}" placeholder="Your Email" />\r\n									</div>\r\n								</div>\r\n							</div> \r\n\r\n\r\n 							<div class="control-group">\r\n								<label class="control-label"  for="subject">\r\n								Subject\r\n								</label>\r\n								<div class="controls">\r\n									<input type="text" id="subject" name="subject" size="40" placeholder="Subject" />\r\n								</div>\r\n							</div> \r\n\r\n \r\n							<div class="control-group">\r\n								<label class="control-label"  for="message">\r\n								Message\r\n								</label>\r\n								<div class="controls">\r\n									<textarea id="message" name="message" rows="6" >Email from: {if member_name}{member_name}{if:else}Guest{/if}, Sent at: {current_time format="%Y %m %d"}</textarea>\r\n								</div> \r\n							</div>\r\n							<div class="control-group">\r\n							<span class="help-block">We will never pass on your details to third parties.</span>\r\n								<div class="form-actions">\r\n									\r\n									<button type="submit" class="btn btn-primary">Submit</button>\r\n								</div>\r\n							</div>\r\n							\r\n							</fieldset>\r\n							{/exp:email:contact_form}						\r\n						</div>\r\n						<div class="span3">\r\n							<address>\r\n							<h3>Address</h3>\r\n									 <p>\r\n										{if ''{exp:cartthrob:view_setting store_phone="yes"}''!=''''}{exp:cartthrob:view_setting store_phone="yes"}<br><br>{/if}\r\n										{exp:cartthrob:view_setting store_address1="yes"}<br />\r\n										{if ''{exp:cartthrob:view_setting store_address2="yes"}''!=''''}{exp:cartthrob:view_setting store_address2="yes" param="1"}<br />{/if}\r\n 										{exp:cartthrob:view_setting store_city="yes"}, {exp:cartthrob:view_setting store_state="yes"}<br />\r\n										{exp:cartthrob:view_setting store_zip="yes"}<br>\r\n										{exp:cartthrob:view_setting store_country="yes"}\r\n										 </p>\r\n							</address>\r\n						</div>\r\n					</div>\r\n				</section>\r\n				</div>\r\n		</div>\r\n	</div>\r\n\r\n	 	{embed="{template_group}/_footer" template="{template}" template_group="{template_group}"}\r\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(7, 1, 1, 'donate', 'y', 'webpage', '{preload_replace:template_group="store"}\n{preload_replace:template="index"}\n \n{embed="{template_group}/_header" title="Make a Donation" template_group="{template_group}" template="{template}" }\n\n</head>\n<body>\n	{embed="{template_group}/_navbar" template_group="{template_group}" template="{template}"}\n\n	{embed="{template_group}/_subhead" template_group="{template_group}" template="{template}"}\n\n	{!-- since we''re using twitter bootstrap, the main content area is designated "container", or some other specific classes depending on your requirements--}\n	<div class="container">\n		{!-- twitter bootstrap breaks up content into rows. The main section of this template is all one row. Rows can also be broken up into more rows --}\n		<div class="row">\n\n			{!-- twitter bootstrap breaks up (by default) pages into a 12 column grid. span3, span9 designate how much space these sections will take up --}\n			<div class="span3">\n				<div class="bs-docs-sidenav">\n					{embed="{template_group}/_leftnav" template_group="{template_group}" template="{template}"}\n			{!-- we''re going to load the "also purchased" info for the last item added to the cart--}\n			{exp:cartthrob:cart_items_info limit="1" order_by="entry_id" sort="desc"}\n				{embed="{template_group}/_also_purchased" template_group="{template_group}" template="{template}" entry_id="{entry_id}"}\n			{/exp:cartthrob:cart_items_info}\n				</div>\n			\n			</div>\n\n			<div class="span9">\n			    <section id="donation">\n					<h1>Make a donation</h1>\n					<p>Thank you for your donation. Please feel free to leave a note with your donation</p>\n					{!-- you can manually add items to the cart using on_the_fly options. You can either set prices as a parameter, or allow_user_price if you''d like the user to be able to set the price--}\n 					{exp:cartthrob:add_to_cart_form \n					    return="{template_group}/view_cart" \n						class=''form-horizontal'' \n						allow_user_price="yes"\n						title="Donation"\n						no_shipping="yes"\n						no_tax="yes"\n					    on_the_fly="true"  \n\n						}\n \n						<div class="control-group">\n					 		<label for="add_donation" class="control-label">Donation Amount</label>\n						    <div class="controls">\n								<div class="input-prepend">\n								  <span class="add-on">{exp:cartthrob:view_setting prefix="yes"}</span>\n									<input type="text" maxlength="7"  class="input-medium"  name="price">\n 								</div>\n								\n 							</div>\n						</div>\n						\n						<div class="control-group">\n					 		<label for="add_donation" class="control-label">Donation Note</label>\n						    <div class="controls">\n								{!-- you can add anything to item options. Just use item_options[your_option_name]  when adding items to the cart --}\n								<input type="text" value="" name="item_options[donation_note]"  /> \n  							</div>\n						</div>\n						\n						<div class="control-group">\n							<div class="form-actions">\n								<button type="submit" class="btn btn-primary">Add to Cart</button>\n				      		</div>\n						</div>\n						\n					{/exp:cartthrob:add_to_cart_form}\n				</section>\n				</div>\n		</div>\n	</div>\n\n 	{embed="{template_group}/_footer" template="{template}" template_group="{template_group}"}\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
