_shipping_first_name} {order_shipping_last_name}<br>\n										{order_shipping_address}<br>\n										{if order_shipping_address2}{order_shipping_address2}<br>{/if}\n										{order_shipping_city}, {order_shipping_state} {order_shipping_zip}\n										{if order_shipping_country_code}{order_shipping_country_code}{/if}\n									{if:else}\n										{order_billing_first_name} {order_billing_last_name}<br>\n										{order_billing_address}<br>\n										{if order_billing_address2}{order_billing_address2}<br>{/if}\n										{order_billing_city}, {order_billing_state} {order_billing_zip}<br>\n										{if order_country_code}{order_country_code}<br>{/if}\n										{order_customer_email}<br>\n										{order_customer_phone}\n									{/if}\n								</span>\n							</td>\n						</tr>\n					</table>\n					<hr>\n\n					Total number of purchased items: {order_items:total_results}.\n					<table cellspacing="0" cellpadding="2" width="100%">\n						<thead>\n							<tr>\n								<td><span style="font-size:12px;font-weight:bold;">ID</span></td>\n								<td><span style="font-size:12px;font-weight:bold;">Description</span></td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Qty</span></td>\n								<td align="center">&nbsp;</td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Price</span></td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Item Total</span></td>\n							</tr>\n						</thead>\n						<tbody>\n							{exp:cartthrob:order_items order_id="{entry_id}" }\n								<tr class="{item:switch="odd|even"}">\n									<td><span style="font-size:12px;">{item:entry_id}</span></td>\n									<td><span style="font-size:12px;">\n										{item:title}\n										{if is_package}\n											<p>\n 											<span style="font-size:9px;">\n											{packages}\n												{sub:title}<br /> \n											{/packages}\n											</span>\n											</p>\n										{/if}\n										</span></td>\n									<td align="right"><span style="font-size:12px;">{item:quantity}</span></td>\n									<td align="center">&nbsp;</td>\n									<td align="right"><span style="font-size:12px;">{item:price}<br />(w/ tax: {item:price_plus_tax})</span></td>\n									<td align="right">\n										<span style="font-size:12px;">\n											{item:subtotal}<br />(w/ tax: {item:subtotal_plus_tax})\n										</span>\n									</td>\n								</tr>\n							{/exp:cartthrob:order_items}\n							<tr>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n								<td colspan="3">&nbsp;</td>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n								<td align="center">&nbsp;</td>\n							</tr>\n						</tbody>\n					</table>\n					<hr>\n					<table cellspacing="0" cellpadding="0" width="100%">\n						<tr>\n							<td align="right">\n								<table cellspacing="0" cellpadding="2">\n									<tr>\n										<td valign="top" align="right"><span style="font-size:12px;">Shipping:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;">{order_shipping}</span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right"><span style="font-size:12px;">Tax:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;">{order_tax}</span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right">&nbsp;</td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;"></span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right"><span style="font-size:14px;font-weight:bold;">Total:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:14px;font-weight:bold;">{order_total}</span></td>\n									</tr>\n								</table>\n							</td>\n						</tr>\n					</table>\n				</td>\n			</tr>\n		</table>\n	{/exp:cartthrob:submitted_order_info}', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(9, 1, 1, 'email_customer', 'y', 'webpage', '{preload_replace:headline="THANK YOU FOR YOUR ORDER"}\n 	{exp:cartthrob:submitted_order_info}\n		<table width="600" cellpadding="5" cellspacing="0">\n			<tr>\n				<td valign="top" align="left" style="font-size:12px;color:#000000;font-family:arial, sans-serif;"><br>\n					<p> <span style="font-size:16px;font-weight:bold;">{headline}</span> </p>\n					<table cellspacing="0" cellpadding="2" bgcolor="#000000" width="100%">\n						<tr>\n							<td><span style="color:#ffffff;font-size:14px;">Order Data</span></td>\n						</tr>\n					</table>\n					<table cellspacing="0" cellpadding="2" width="100%">\n						<tr>\n							<td valign="top">\n								<span style="font-size:12px;font-weight:bold;">Order Date: </span> \n								<span style="font-size:12px;">{entry_date format="%M %d, %Y"}</span>\n							</td>\n						</tr>\n					</table>\n					<table cellspacing="0" cellpadding="0" width="100%">\n						<tr>\n							<td valign="top">\n								<span style="font-size:12px; font-weight:bold;">Order ID: </span> \n								<span style="font-size:12px;">{title}</span>\n							</td>\n						</tr>\n					</table>\n					<hr>\n					<table cellspacing="0" cellpadding="0" width="100%">\n						<tr>\n							<td width="250" valign="top">\n								<span style="font-size:14px; font-weight:bold; ">Billing</span><br>\n								<span style="font-size:12px; ">   \n									{order_billing_first_name} {order_billing_last_name}<br>\n									{order_billing_address}<br>\n									{if order_billing_address2}{order_billing_address2}<br>{/if}\n									{order_billing_city}, {order_billing_state} {order_billing_zip}<br>\n									{if order_country_code}{order_country_code}<br>{/if}\n									{order_customer_email}<br>\n									{order_customer_phone}\n								</span>\n							</td>\n							<td valign="top">\n								<span style="font-size:14px; font-weight:bold;">Shipping</span><br>\n								<span style="font-size:12px; ">   \n									{if order_shipping_address}\n										{order_shipping_first_name} {order_shipping_last_name}<br>\n										{order_shipping_address}<br>\n										{if order_shipping_address2}{order_shipping_address2}<br>{/if}\n										{order_shipping_city}, {order_shipping_state} {order_shipping_zip}\n										{if order_shipping_country_code}{order_shipping_country_code}{/if}\n									{if:else}\n										{order_billing_first_name} {order_billing_last_name}<br>\n										{order_billing_address}<br>\n										{if order_billing_address2}{order_billing_address2}<br>{/if}\n										{order_billing_city}, {order_billing_state} {order_billing_zip}<br>\n										{if order_country_code}{order_country_code}<br>{/if}\n										{order_customer_email}<br>\n										{order_customer_phone}\n									{/if}\n								</span>\n							</td>\n						</tr>\n					</table>\n					<hr>\n\n					Total number of purchased items: {order_items:total_results}.\n					<table cellspacing="0" cellpadding="2" width="100%">\n						<thead>\n							<tr>\n								<td><span style="font-size:12px;font-weight:bold;">ID</span></td>\n								<td><span style="font-size:12px;font-weight:bold;">Description</span></td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Qty</span></td>\n								<td align="center">&nbsp;</td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Price</span></td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Item Total</span></td>\n								<td align="center">&nbsp;</td>\n							</tr>\n						</thead>\n						<tbody>\n							{exp:cartthrob:order_items order_id="{entry_id}" }\n								<tr class="{item:switch="odd|even"}">\n									<td><span style="font-size:12px;">{item:entry_id}</span></td>\n									<td><span style="font-size:12px;">\n										{item:title}\n										{if is_package}\n											<p>\n 											<span style="font-size:9px;">\n											{packages}\n												{sub:title}<br /> \n											{/packages}\n											</span>\n											</p>\n										{/if}\n										</span></td>\n									<td align="right"><span style="font-size:12px;">{item:quantity}</span></td>\n									<td align="center">&nbsp;</td>\n									<td align="right"><span style="font-size:12px;">{item:price}<br />(w/ tax: {item:price_plus_tax})</span></td>\n									<td align="right">\n										<span style="font-size:12px;">\n											{item:subtotal}<br />(w/ tax: {item:subtotal_plus_tax})\n										</span>\n									</td>\n									<td align="right">\n										{if item:product_download_url}\n										<span style="font-size:12px;"><a href="{exp:cartthrob:get_download_link field=''product_download_url'' entry_id=''{item:entry_id}''}">Download</a></span>\n										{/if}\n									</td>\n								</tr>\n							{/exp:cartthrob:order_items}\n							<tr>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n								<td colspan="3">&nbsp;</td>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n							</tr>\n						</tbody>\n					</table>\n					<hr>\n					<table cellspacing="0" cellpadding="0" width="100%">\n						<tr>\n							<td align="right">\n								<table cellspacing="0" cellpadding="2">\n									<tr>\n										<td valign="top" align="right"><span style="font-size:12px;">Shipping:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;">{order_shipping}</span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right"><span style="font-size:12px;">Tax:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;">{order_tax}</span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right">&nbsp;</td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;"></span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right"><span style="font-size:14px;font-weight:bold;">Total:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:14px;font-weight:bold;">{order_total}</span></td>\n									</tr>\n								</table>\n							</td>\n						</tr>\n					</table>\n				</td>\n			</tr>\n		</table>\n	{/exp:cartthrob:submitted_order_info}', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(10, 1, 1, 'email_low_stock', 'y', 'webpage', 'Low stock notification for item number {entry_id}. Stock level is currently at {inventory}', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(11, 1, 1, 'email_status_change', 'y', 'webpage', 'Your order''s status has changed: \n\nOrder Id: {entry_id} <br />\nCurrent Status: {status} <br />\nPrevious Status:{previous_status} <br />\nChannel ID {channel_id} <br />\nURL title {url_title} <br />\n\n{exp:channel:entries entry_id="{entry_id}"}\n\n{title}\n\n{/exp:channel:entries}', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(12, 1, 1, 'index', 'y', 'webpage', '{preload_replace:template_group="store"}\n{preload_replace:template="index"}\n \n{embed="{template_group}/_header" title="Shopping Cart" template_group="{template_group}" template="{template}" }\n \n</head>\n<body>\n	{embed="{template_group}/_navbar" template_group="{template_group}" template="{template}"}\n\n	{embed="{template_group}/_subhead" template_group="{template_group}" template="{template}"}\n\n	{!-- since we''re using twitter bootstrap, the main content area is designated "container", or some other specific classes depending on your requirements--}\n	<div class="container">\n		{!-- twitter bootstrap breaks up content into rows. The main section of this template is all one row. Rows can also be broken up into more rows --}\n		<div class="row">\n\n			{!-- twitter bootstrap breaks up (by default) pages into a 12 column grid. span3, span9 designate how much space these sections will take up --}\n			<div class="span3">\n				<div class="bs-docs-sidenav">\n					{embed="{template_group}/_leftnav" template_group="{template_group}" template="{template}"}\n				</div>\n			</div>\n\n			<div class="span9">\n				<section id="main">\n					{exp:channel:entries channel="products" limit="30"  dynamic="no"}\n						{if count==1}<h2>Available Products</h2><ul class="thumbnails">{/if}\n							{switch="<div class=''row''>||"}\n							<li class="span3">						\n 							\n						<div class="thumbnail">\n							{if product_thumbnail}\n									<a class='''' href="{entry_id_path=''{template_group}/product_detail''}"><img src="{product_thumbnail}" /></a>\n							{if:else}\n							<a class='''' href="{entry_id_path=''{template_group}/product_detail''}"><img src="http://placehold.it/300x200" alt=""></a>\n							{/if}\n							<div class="caption">\n								<h3>{title}</h3>\n							\n								<p>\n									{if product_original_price && product_original_price > product_price}\n										<h4>{product_price} <small><strong>Sale Price</strong> <i class="icon-tags"></i></small></h4>\n											<div class="alert alert-info">\n												<del><small>Regular Price: <strong>{product_original_price}</strong></small></del>\n											</div>\n									{if:else}\n									<h4>{product_price} <small><strong>Regular Price</strong></small></h4>\n									{/if}\n\n									{if no_tax !="Yes"}<small>including tax: {product_price:plus_tax}</small>{/if}\n						\n								</p>\n								 <a class=''btn btn-primary btn-mini'' href="{entry_id_path={template_group}/product_detail}">Learn more &raquo;</a>\n							</div>\n						</div>\n						</li>\n						{switch="||</div>"}\n						{if count==total_results}</ul><!-- end row -->{/if}\n					{/exp:channel:entries}\n					\n					{exp:channel:entries channel="store_packages" limit="30"  dynamic="no"}\n					{if count==1}<h2>Available Packages</h2><ul class="thumbnails">{/if}\n						{switch="<div class=''row''>||"}\n						\n						<li class="span3">						\n						\n						<div class="thumbnail">\n							{if packages_images}\n									<a href="{entry_id_path=''{template_group}/package_detail''}"><img src="{packages_images}" /></a>\n							{if:else}\n								<a class='''' href="{entry_id_path=''{template_group}/package_detail''}"><img src="http://placehold.it/300x200" alt=""></a>\n							{/if}\n							<div class="caption">\n								<h3>{title}</h3>\n								{if packages_images}\n										<a href="{entry_id_path=''{template_group}/package_detail''}"><img src="{packages_images}" /></a>\n								{/if}\n\n								<h4>{packages_packages:price} <small><strong>Regular Price</strong></small></h4>\n \n								<small>including tax: {packages_packages:plus_tax}</small>\n \n								<p><strong>Package Features: </strong><br />\n									{packages_packages}\n						 				- {title}<br /> \n									{/packages_packages}\n								</p>\n								<a class=''btn btn-primary btn-mini''  href="{entry_id_path={template_group}/package_detail}">Learn more &raquo;</a></p>\n							</div>\n						</div>\n						</li>\n						{switch="||</div>"}\n						\n						{if count==total_results}</ul><!-- end row -->{/if}\n						\n					{/exp:channel:entries}\n					</section>\n				</div>\n		</div>\n	</div>\n\n 	{embed="{template_group}/_footer" template="{template}" template_group="{template_group}"}\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 10, 'n'),
(13, 1, 1, 'invoice', 'y', 'webpage', '{!-- the account template sends the ID of the entry encrypted. In this template, the ID is being decrypted. If found, it will load the invoice template that contains the data\n	Using this method, you can share the invoice link with someone that is not logged in.\n	 --}\n{preload_replace:template_group="store"}\n{if "{exp:cartthrob:view_decrypted_string string=''{segment_3}'' parse_inward=''yes''}" !="" }\n	{embed="{template_group}/_invoice" entry_id="{exp:cartthrob:view_decrypted_string string=''{segment_3}'' parse_inward="yes"}"}\n{if:elseif entry_id}\n	{embed="{template_group}/_invoice" entry_id="{entry_id}"}\n\n{if:else}\n	Invoice could not be found\n{/if}\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n');
INSERT INTO `ls_templates` (`template_id`, `site_id`, `group_id`, `template_name`, `save_template_file`, `template_type`, `template_data`, `template_notes`, `edit_date`, `last_author_id`, `cache`, `refresh`, `no_auth_bounce`, `enable_http_auth`, `allow_php`, `php_parse_location`, `hits`, `protect_javascript`) VALUES
(14, 1, 1, 'main.css', 'y', 'css', '/* Add additional stylesheets below\n-------------------------------------------------- */\n/*\n  Bootstrap''s documentation styles\n  Special styles for presenting Bootstrap''s documentation and examples\n*/\n\n\n\n/* Body and structure\n-------------------------------------------------- */\n\nbody {\n  position: relative;\n  padding-top: 40px;\n}\n\n/* Code in headings */\nh3 code {\n  font-size: 14px;\n  font-weight: normal;\n}\n\n\n\n/* Tweak navbar brand link to be super sleek\n-------------------------------------------------- */\n\nbody > .navbar {\n  font-size: 13px;\n}\n\n/* Change the brand */\nbody > .navbar .brand {\n  padding-right: 0;\n  padding-left: 0;\n  margin-left: 20px;\n  float: right;\n  font-weight: bold;\n  color: #cfcfcf;\n  text-shadow: 0 1px 0 rgba(255,255,255,.1), 0 0 30px rgba(255,255,255,.125);\n  -webkit-transition: all .2s linear;\n     -moz-transition: all .2s linear;\n          transition: all .2s linear;\n}\nbody > .navbar .brand:hover {\n  text-decoration: none;\n  text-shadow: 0 1px 0 rgba(255,255,255,.1), 0 0 30px rgba(255,255,255,.4);\n}\n\n#leftnav{\n  margin: 30px 0 0;\n  }\n\n.affix {\n    top: 20px; \n }\n/* Sections\n-------------------------------------------------- */\n\n/* padding for in-page bookmarks and fixed navbar */\nsection {\n  padding-top: 30px;\n}\n\nsection > ul li {\n  margin-bottom: 5px;\n}\n \n/* Faded out hr */\nhr.soften {\n  height: 1px;\n  margin: 70px 0;\n  background-image: -webkit-linear-gradient(left, rgba(0,0,0,0), rgba(0,0,0,.1), rgba(0,0,0,0));\n  background-image:    -moz-linear-gradient(left, rgba(0,0,0,0), rgba(0,0,0,.1), rgba(0,0,0,0));\n  background-image:     -ms-linear-gradient(left, rgba(0,0,0,0), rgba(0,0,0,.1), rgba(0,0,0,0));\n  background-image:      -o-linear-gradient(left, rgba(0,0,0,0), rgba(0,0,0,.1), rgba(0,0,0,0));\n  border: 0;\n}\n\n\n\n/* Jumbotrons\n-------------------------------------------------- */\n\n/* Base class\n------------------------- */\n.jumbotron {\n  position: relative;\n  padding: 15px 0;\n  color: #fff;\n  text-align: center;\n  \n  text-shadow: 0 1px 3px rgba(0,0,0,.4), 0 0 30px rgba(0,0,0,.075);\n  \nbackground: #103c51; /* Old browsers */\nbackground: -moz-linear-gradient(45deg, #103c51 0%, #5a89a8 68%); /* FF3.6+ */\nbackground: -webkit-gradient(linear, left bottom, right top, color-stop(0%,#103c51), color-stop(68%,#5a89a8)); /* Chrome,Safari4+ */\nbackground: -webkit-linear-gradient(45deg, #103c51 0%,#5a89a8 68%); /* Chrome10+,Safari5.1+ */\nbackground: -o-linear-gradient(45deg, #103c51 0%,#5a89a8 68%); /* Opera 11.10+ */\nbackground: -ms-linear-gradient(45deg, #103c51 0%,#5a89a8 68%); /* IE10+ */\nbackground: linear-gradient(45deg, #103c51 0%,#5a89a8 68%); /* W3C */\nfilter: progid:DXImageTransform.Microsoft.gradient( startColorstr=''#103c51'', endColorstr=''#5a89a8'',GradientType=1 ); /* IE6-9 fallback on horizontal gradient */\n  -webkit-box-shadow: inset 0 3px 7px rgba(0,0,0,.2), inset 0 -3px 7px rgba(0,0,0,.2);\n     -moz-box-shadow: inset 0 3px 7px rgba(0,0,0,.2), inset 0 -3px 7px rgba(0,0,0,.2);\n          box-shadow: inset 0 3px 7px rgba(0,0,0,.2), inset 0 -3px 7px rgba(0,0,0,.2);\n}\n\n\n.jumbotron.purple{\n  position: relative;\n  padding: 15px 0;\n  color: #fff;\n  text-align: center;\n  \n  text-shadow: 0 1px 3px rgba(0,0,0,.4), 0 0 30px rgba(0,0,0,.075);\n  \n  background: #020031; /* Old browsers */\n  background: -moz-linear-gradient(45deg,  #020031 0%, #6d3353 100%); /* FF3.6+ */\n  background: -webkit-gradient(linear, left bottom, right top, color-stop(0%,#020031), color-stop(100%,#6d3353)); /* Chrome,Safari4+ */\n  background: -webkit-linear-gradient(45deg,  #020031 0%,#6d3353 100%); /* Chrome10+,Safari5.1+ */\n  background: -o-linear-gradient(45deg,  #020031 0%,#6d3353 100%); /* Opera 11.10+ */\n  background: -ms-linear-gradient(45deg,  #020031 0%,#6d3353 100%); /* IE10+ */\n  background: linear-gradient(45deg,  #020031 0%,#6d3353 100%); /* W3C */\n  filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=''#020031'', endColorstr=''#6d3353'',GradientType=1 ); /* IE6-9 fallback on horizontal gradient */\n  -webkit-box-shadow: inset 0 3px 7px rgba(0,0,0,.2), inset 0 -3px 7px rgba(0,0,0,.2);\n     -moz-box-shadow: inset 0 3px 7px rgba(0,0,0,.2), inset 0 -3px 7px rgba(0,0,0,.2);\n          box-shadow: inset 0 3px 7px rgba(0,0,0,.2), inset 0 -3px 7px rgba(0,0,0,.2);\n	\n}\n.jumbotron h1 {\n  font-size: 60px;\n  font-weight: bold;\n  letter-spacing: -1px;\n  line-height: 1;\n}\n.jumbotron p {\n  font-size: 19px;\n  font-weight: 300;\n  line-height: 1.25;\n  margin-bottom: 30px;\n}\n\n/* Link styles (used on .masthead-links as well) */\n.jumbotron a {\n  color: #fff;\n  color: rgba(255,255,255,.5);\n  -webkit-transition: all .2s ease-in-out;\n     -moz-transition: all .2s ease-in-out;\n          transition: all .2s ease-in-out;\n}\n.jumbotron a:hover {\n  color: #fff;\n  text-shadow: 0 0 10px rgba(255,255,255,.25);\n}\n\n/* Pattern overlay\n------------------------- */\n.jumbotron .container {\n  position: relative;\n  z-index: 2;\n}\n.jumbotron:after {\n  content: '''';\n  display: block;\n  position: absolute;\n  top: 0;\n  right: 0;\n  bottom: 0;\n  left: 0;\n  background: url(../img/bs-docs-masthead-pattern.png) repeat center center;\n  opacity: .4;\n}\n \n/* Subhead\n------------------------- */\n.subhead {\n  text-align: left;\n  border-bottom: 1px solid #ddd;\n}\n.subhead h1 {\n  font-size: 35px;\n}\n.subhead p {\n  margin-bottom: 12px;\n}\n.subhead .navbar {\n  display: none;\n}\n\n\n\n/* Footer\n-------------------------------------------------- */\n\n.footer {\n  padding: 70px 0;\n  margin-top: 70px;\n  border-top: 1px solid #e5e5e5;\n  background-color: #f5f5f5;\n}\n.footer p {\n  margin-bottom: 0;\n  color: #777;\n}\n.footer-links {\n  margin: 10px 0;\n}\n.footer-links li {\n  display: inline;\n  padding: 0 2px;\n}\n.footer-links li:first-child {\n  padding-left: 0;\n}\n\n\n/* Misc\n-------------------------------------------------- */\n\n/* Make tables spaced out a bit more */\nh2 + table,\nh3 + table,\nh4 + table,\nh2 + .row {\n  margin-top: 5px;\n}\n\n\n\n\n/* Responsive\n-------------------------------------------------- */\n\n\n/* Desktop\n------------------------- */\n@media (max-width: 980px) {\n  /* Unfloat brand */\n  body > .navbar-fixed-top .brand {\n    float: left;\n    margin-left: 0;\n    padding-left: 10px;\n    padding-right: 10px;\n  }\n}\n\n/* Tablet to desktop\n------------------------- */\n@media (min-width: 768px) and (max-width: 980px) {\n  /* Remove any padding from the body */\n  body {\n    padding-top: 0;\n  }\n  /* Widen masthead and social buttons to fill body padding */\n  .jumbotron {\n    margin-top: -20px; /* Offset bottom margin on .navbar */\n  }\n}\n\n/* Tablet\n------------------------- */\n@media (max-width: 767px) {\n  /* Remove any padding from the body */\n  body {\n    padding-top: 0;\n  }\n\n  /* Widen masthead and social buttons to fill body padding */\n  .jumbotron {\n    padding: 40px 20px;\n    margin-top:   -20px; /* Offset bottom margin on .navbar */\n    margin-right: -20px;\n    margin-left:  -20px;\n  }\n  /* Unfloat the back to top link in footer */\n  .footer {\n    margin-left: -20px;\n    margin-right: -20px;\n    padding-left: 20px;\n    padding-right: 20px;\n  }\n  .footer p {\n    margin-bottom: 9px;\n  }\n}\n\n/* Landscape phones\n------------------------- */\n@media (max-width: 480px) {\n  /* Remove padding above jumbotron */\n  body {\n    padding-top: 0;\n  }\n\n  /* Change up some type stuff */\n  h2 small {\n    display: block;\n  }\n\n  /* Downsize the jumbotrons */\n  .jumbotron h1 {\n    font-size: 45px;\n  }\n  .jumbotron p,\n  .jumbotron .btn {\n    font-size: 18px;\n  }\n  .jumbotron .btn {\n    display: block;\n    margin: 0 auto;\n  }\n\n  /* center align subhead text like the masthead */\n  .subhead h1,\n  .subhead p {\n    text-align: center;\n  }\n\n  /* Tighten up footer */\n  .footer {\n    padding-top: 20px;\n    padding-bottom: 20px;\n  }\n  /* Unfloat the back to top in footer to prevent odd text wrapping */\n  .footer .pull-right {\n    float: none;\n  }\n}', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
