tax --}	\n	\n	{!-- Below is the old relationship method for use with versions less than EE2.5 --}\n	{!-- start old syntax\n	{if product_related_1 OR product_related_2 OR product_related_3}\n 		<h5>You Might Also Like</h5>\n		<ul  class="nav nav-tabs nav-stacked">\n	{/if}\n	{related_entries id="product_related_1"}\n		<li>\n			<a href="{entry_id_path=''{embed:template_group}/product_detail''}">\n				<i class="icon-chevron-right"></i>\n				<img src="{product_thumbnail}" />\n				{title}<br />\n				{if product_price}{product_price}{if:elseif packages_price}{packages_price}{/if} &raquo;\n			</a>\n		</li>\n	{/related_entries}\n\n	{related_entries id="product_related_2"}\n		<li>\n			<a href="{entry_id_path=''{embed:template_group}/product_detail''}">\n				<i class="icon-chevron-right"></i>\n				<img src="{product_thumbnail}" />\n				{title}<br />\n				{if product_price}{product_price}{if:elseif packages_price}{packages_price}{/if} &raquo;\n			</a>\n		</li>\n	{/related_entries}\n	\n	{related_entries id="product_related_3"}\n		<li>\n			<a href="{entry_id_path=''{embed:template_group}/product_detail''}">\n				<i class="icon-chevron-right"></i>\n				<img src="{product_thumbnail}" />\n				{title}<br />\n				{if product_price}{product_price}{if:elseif packages_price}{packages_price}{/if} &raquo;\n			</a>\n		</li>\n	{/related_entries}\n	\n	{if product_related_1 OR product_related_2 OR product_related_3}\n			</ul>\n 	{/if}	\n	end old syntax --}\n{/exp:channel:entries}\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n');
INSERT INTO `ls_templates` (`template_id`, `site_id`, `group_id`, `template_name`, `save_template_file`, `template_type`, `template_data`, `template_notes`, `edit_date`, `last_author_id`, `cache`, `refresh`, `no_auth_bounce`, `enable_http_auth`, `allow_php`, `php_parse_location`, `hits`, `protect_javascript`) VALUES
(24, 1, 1, '_footer', 'y', 'webpage', '	<!-- Footer\r\n	================================================== -->\r\n	<footer class="footer">\r\n	  <div class="container">\r\n	    <p class="pull-right"><a href="#">Back to top</a></p>\r\n\r\n	    <p>&copy;{current_time format="%Y"} {exp:cartthrob:view_setting store_name="yes"}</p>\r\n		<p>powered by <a href="http://livecart.com">CartThrob eCommerce</a></p>\r\n	\r\n	    <ul class="footer-links">\r\n		  <li><a href=''{site_url}''>Home</a></li>\r\n	      <li class="muted">&middot;</li>\r\n	      <li><a href="{path=''{embed:template_group}/privacy_policy''}">Privacy Policy</a></li>\r\n	      <li class="muted">&middot;</li>\r\n	      <li><a href="{path=''{embed:template_group}/return_policy''}">Return Policy</a></li>\r\n	      <li class="muted">&middot;</li>\r\n		  <li><a href="{path=''{embed:template_group}/about''}">About Us</a></li>\r\n	    </ul>\r\n	  </div>\r\n	</footer>\r\n	\r\n	{!-- this form is used for hidden ajax submissions by CartThrob. D--}\r\n	<div style="display:none" id="hidden_save_customer_info_form_wrapper">\r\n		{!-- Data input in other forms is copied to this form, and submitted \r\n			if debug is turned on in the javascript file, this form should be automatically shown.\r\n			--}\r\n		{exp:cartthrob:save_customer_info_form return="" id="hidden_save_customer_info_form" }\r\n			<div class="cart_data">\r\n\r\n			</div>\r\n		<input type="submit" name="Submit" /> \r\n		{/exp:cartthrob:save_customer_info_form}\r\n	</div>\r\n\r\n\r\n<div class="modal hide fade" id="login">\r\n		{exp:member:login_form return="{path={segment_1}/{segment_2}/{segment_3}/{segment_4}}" class="form-horizontal"}\r\n	<div class="modal-header">\r\n		<button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>\r\n		<h3>Login</h3>\r\n	</div>\r\n	<div class="modal-body">\r\n		<label>Username</label> <input type="text" class=''input-medium'' name="username" value="" placeholder=''Username'' /> \r\n		<label>Password</label> <input type="password" class=''input-medium'' name="password" value="" placeholder="Password"   /> \r\n	</div>\r\n	<div class="modal-footer">\r\n		<a href="#" class="btn">Close</a>\r\n		<input type="submit" name="submit" value="Login" class="btn btn-primary" /> \r\n	</div>\r\n	{/exp:member:login_form}\r\n</div>	\r\n\r\n{!-- if you''ve set the google analytics code in the backend, this will output the google analytics tag --}\r\n{if ''{exp:cartthrob:view_setting store_google_code="yes"}''!=''''}\r\n<script type="text/javascript">\r\n\r\n  var _gaq = _gaq || [];\r\n  _gaq.push([''_setAccount'', ''{exp:cartthrob:view_setting store_google_code="yes"}'']);\r\n  _gaq.push([''_trackPageview'']);\r\n\r\n  (function() {\r\n    var ga = document.createElement(''script''); ga.type = ''text/javascript''; ga.async = true;\r\n    ga.src = (''https:'' == document.location.protocol ? ''https://ssl'' : ''http://www'') + ''.google-analytics.com/ga.js'';\r\n    var s = document.getElementsByTagName(''script'')[0]; s.parentNode.insertBefore(ga, s);\r\n  })();\r\n\r\n</script>\r\n{/if}\r\n</body>\r\n</html>', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(25, 1, 1, '_header', 'y', 'webpage', '{!-- we''re setting the doctype specifically like this so that we can use Twitter Bootstrap.\nhttp://twitter.github.com/bootstrap/scaffolding.html#global\n --}\n<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>{embed:title} - {site_name}</title>\n\n	{!-- ///////// SAMPLE TEMPLATE //////////////// --}\n	{!-- CT ajax uses jQuery. Include your own or EE''s included version --}\n	{exp:jquery:script_tag}\n	{!-- CT uses jQuery form for ajax form submissions --}\n	<script type="text/javascript" src="{theme_folder_url}third_party/cartthrob/scripts/jquery.form.js" ></script>\n	{!-- CT sample templates  form for ajax form submissions --}\n	<script type="text/javascript" src="{path=''{embed:template_group}/cart.js''}" ></script>\n\n\n	{!-- CT template CSS files --}\n	<link rel="stylesheet" type="text/css" media="all" href="{stylesheet={embed:template_group}/main.css}" />\n    \n	{!-- ///////// TWITTER BOOSTRAP //////////////// --}\n	{!-- http://twitter.github.com/bootstrap/getting-started.html --}\n\n	<meta name="viewport" content="width=device-width, initial-scale=1.0">\n	\n	{!-- Twitter Boostrap CSS files. The sample templates use Twitter Bootstrap for layout, styles and some JS functionality. --}\n	<link href="{theme_folder_url}third_party/cartthrob/bootstrap/css/bootstrap.min.css" rel="stylesheet" media="screen">\n	\n	{!-- NOTE: if you don''t like things to move around on the page, comment this out. This enables responsive layout, \n		and the contents of the page flow to fit the viewport --}\n	<link href="{theme_folder_url}third_party/cartthrob/bootstrap/css/bootstrap-responsive.css" rel="stylesheet">\n<script type="text/javascript" src="{theme_folder_url}third_party/cartthrob/bootstrap/js/bootstrap.js" ></script>\n\n	<!-- HTML5 shim, for IE6-8 support of HTML5 elements -->\n	<!--[if lt IE 9]>\n	  <script src="http://html5shim.googlecode.com/svn/trunk/html5.js"></script>\n	<![endif]-->\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(26, 1, 1, '_invoice', 'y', 'webpage', '{!--This template is embedded so that we can decrypt and pass the invoice ID to it so that it can be viewed offline --}\n\n{exp:channel:entries channel="orders" limit="1" status="not none" dynamic="no" entry_id="{embed:entry_id}" parse_inward="yes" show_future_entries="yes" }\n{if no_results}This invoice could not be found{/if}\n{!-- invoice template  Add your store information somewhere on this invoice! --}\n		<table width="600" cellpadding="5" cellspacing="0">\n			<tr>\n				<td valign="top" align="left" style="font-size:12px;color:#000000;font-family:arial, sans-serif;"><br>\n					<p> <span style="font-size:16px;font-weight:bold;">INVOICE</span> </p>\n					<table cellspacing="0" cellpadding="2" bgcolor="#000000" width="100%">\n						<tr>\n							<td><span style="color:#ffffff;font-size:14px;">Order Data</span></td>\n						</tr>\n					</table>\n					<table cellspacing="0" cellpadding="2" width="100%">\n						<tr>\n							<td valign="top">\n								<span style="font-size:12px;font-weight:bold;">Order Date: </span> \n								<span style="font-size:12px;">{entry_date format="%M %D %Y"}</span>\n							</td>\n						</tr>\n					</table>\n					<table cellspacing="0" cellpadding="0" width="100%">\n						<tr>\n							<td valign="top">\n								<span style="font-size:12px; font-weight:bold;">Order ID: </span> \n								<span style="font-size:12px;">{title}</span>\n							</td>\n						</tr>\n					</table>\n					<hr>\n					<table cellspacing="0" cellpadding="0" width="100%">\n						<tr>\n							<td width="250" valign="top">\n								<span style="font-size:14px; font-weight:bold; ">Billing</span><br>\n								<span style="font-size:12px; ">   \n									{order_billing_first_name} {order_billing_last_name}<br>\n									{order_billing_address}<br>\n									{if order_billing_address2}{order_billing_address2}<br>{/if}\n									{order_billing_city}, {order_billing_state} {order_billing_zip}<br>\n									{if order_country_code}{order_country_code}<br>{/if}\n									{order_customer_email}<br>\n									{order_customer_phone}\n								</span>\n							</td>\n							<td valign="top">\n								<span style="font-size:14px; font-weight:bold;">Shipping</span><br>\n								<span style="font-size:12px; ">   \n									{if order_shipping_address}\n										{order_shipping_first_name} {order_shipping_last_name}<br>\n										{order_shipping_address}<br>\n										{if order_shipping_address2}{order_shipping_address2}<br>{/if}\n										{order_shipping_city}, {order_shipping_state} {order_shipping_zip}\n										{if order_shipping_country_code}{order_shipping_country_code}{/if}\n									{if:else}\n										{order_billing_first_name} {order_billing_last_name}<br>\n										{order_billing_address}<br>\n										{if order_billing_address2}{order_billing_address2}<br>{/if}\n										{order_billing_city}, {order_billing_state} {order_billing_zip}<br>\n										{if order_country_code}{order_country_code}<br>{/if}\n										{order_customer_email}<br>\n										{order_customer_phone}\n									{/if}\n								</span>\n							</td>\n						</tr>\n					</table>\n					<hr>\n\n					<p>Total number of purchased items: {order_items:total_results}.</p>\n					<table cellspacing="0" cellpadding="2" width="100%">\n						<thead>\n							<tr>\n								<td><span style="font-size:12px;font-weight:bold;">ID</span></td>\n								<td><span style="font-size:12px;font-weight:bold;">Description</span></td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Qty</span></td>\n								<td align="center">&nbsp;</td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Price</span></td>\n								<td align="right"><span style="font-size:12px;font-weight:bold;">Item Total</span></td>\n								<td align="center">&nbsp;</td>\n							</tr>\n						</thead>\n						<tbody>\n							{exp:cartthrob:order_items order_id="{entry_id}" }\n								<tr class="{item:switch="odd|even"}">\n									<td><span style="font-size:12px;">{item:entry_id}</span></td>\n									<td><span style="font-size:12px;">\n										{item:title}\n										{if is_package}\n											<p>\n 											<span style="font-size:9px;">\n											{packages}\n												{sub:title}<br /> \n											{/packages}\n											</span>\n											</p>\n										{/if}\n										</span></td>\n									<td align="right"><span style="font-size:12px;">{item:quantity}</span></td>\n									<td align="center">&nbsp;</td>\n									<td align="right"><span style="font-size:12px;">{item:price}<br />(w/ tax: {item:price_plus_tax})</span></td>\n									<td align="right">\n										<span style="font-size:12px;">\n											{item:subtotal}<br />(w/ tax: {item:subtotal_plus_tax})\n										</span>\n									</td>\n									<td align="right">\n										{if item:product_download_url}\n										<span style="font-size:12px;"><a href="{exp:cartthrob:get_download_link field=''product_download_url'' entry_id=''{item:entry_id}''}">Download</a></span>\n										{/if}\n									</td>\n								</tr>\n							{/exp:cartthrob:order_items}\n							<tr>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n								<td colspan="3">&nbsp;</td>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n								<td><span style="font-size:12px;">&nbsp;</span></td>\n							</tr>\n						</tbody>\n					</table>\n					<hr>\n					<table cellspacing="0" cellpadding="0" width="100%">\n						<tr>\n							<td align="right">\n								<table cellspacing="0" cellpadding="2">\n									<tr>\n										<td valign="top" align="right"><span style="font-size:12px;">Shipping:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;">{order_shipping}</span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right"><span style="font-size:12px;">Tax:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;">{order_tax}</span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right">&nbsp;</td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:12px;"></span></td>\n									</tr>\n									<tr>\n										<td valign="top" align="right"><span style="font-size:14px;font-weight:bold;">Total:</span></td>\n										<td valign="top" align="right"></td>\n										<td valign="top" align="right"><span style="font-size:14px;font-weight:bold;">{order_total}</span></td>\n									</tr>\n								</table>\n							</td>\n						</tr>\n					</table>\n				</td>\n			</tr>\n		</table>\n	{/exp:channel:entries}\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(27, 1, 1, '_leftnav', 'y', 'webpage', '<!-- Left nav\n================================================== -->\n		<ul class="nav nav-list">\n		<li>						\n			<a href="{path="{embed:template_group}/{exp:cartthrob:view_setting store_checkout_page=''yes''}"}">\n				<strong>Total</strong>\n			<span class="sale_price pull-right"><span class="cart_total">{exp:cartthrob:cart_total}</span></span>\n			</a>\n		</li>\n		<li>\n			<a href="{path="{embed:template_group}/{exp:cartthrob:view_setting store_checkout_page=''yes''}"}">\n			<small><strong>Subtotal</strong></small>\n			<span class="cart_subtotal pull-right">{exp:cartthrob:cart_subtotal}</span>\n			</a>\n		</li>\n		<li>\n			<a href="{path="{embed:template_group}/{exp:cartthrob:view_setting store_checkout_page=''yes''}"}">\n			<small><strong>Shipping</strong></small>\n			<span class="cart_shipping pull-right">{exp:cartthrob:cart_shipping}</span>\n			</a>\n		\n		</li>\n		<li>\n			<a href="{path="{embed:template_group}/{exp:cartthrob:view_setting store_checkout_page=''yes''}"}">\n			<small><strong>Tax</strong></small>\n			<span class="cart_tax pull-right">{exp:cartthrob:cart_tax}</span>\n			</a>\n		</li>\n		<li>\n			<a href="{path="{embed:template_group}/{exp:cartthrob:view_setting store_checkout_page=''yes''}"}">\n			<small><strong>Discount</strong></small>\n			<span class="cart_discount pull-right">{exp:cartthrob:cart_discount}</span>\n			</a>\n		</li>\n		<li>\n			<a href="{path=''{embed:template_group}/view_cart''}">\n			<i class="icon-shopping-cart"></i> <small><strong>View Cart</strong></small> <span class="badge badge-info">{exp:cartthrob:total_items_count}</span> \n 			</a>\n		\n		</li>\n		\n 		</ul>\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(28, 1, 1, '_navbar', 'y', 'webpage', '<!-- Navbar\n================================================== -->\n<div class="navbar navbar-inverse navbar-fixed-top">\n  <div class="navbar-inner">\n    <div class="container">\n      <button type="button" class="btn btn-navbar" data-toggle="collapse" data-target=".nav-collapse">\n        <span class="icon-bar"></span>\n        <span class="icon-bar"></span>\n        <span class="icon-bar"></span>\n      </button>\n      <a class="brand" href="{site_url}">{exp:cartthrob:view_setting store_name=''yes''}</a>\n      <div class="nav-collapse collapse" style="height: 0px" >\n        <ul class="nav">\n          <li {if segment_2==""}class="active"{if:else}class=''''{/if} >\n            <a href="{path=''{embed:template_group}/''}">Store</a>\n          </li>\n          <li {if segment_2=="about"}class="active"{if:else}class=''''{/if} >\n            <a href="{path=''{embed:template_group}/about''}">About Us</a>\n          </li>\n          <li  {if segment_2=="contact"}class="active"{if:else}class=''''{/if} >\n            <a href="{path=''{embed:template_group}/contact''}">Contact</a>\n          </li>\n          <li  {if segment_2=="donate"}class="active"{if:else}class=''''{/if} >\n            <a href="{path=''{embed:template_group}/donate''}">Donate</a>\n          </li>\n          <li  {if segment_2=="view_cart"}class="active"{if:else}class=''''{/if} ><a href="{path=''{embed:template_group}/view_cart''}"><i class="icon-shopping-cart icon-white"></i> Cart ({exp:cartthrob:total_items_count}) <span class="cart_total">{exp:cartthrob:cart_total}</span></a>\n          </li>\n          <li  {if segment_2=="checkout" OR segment_2=="shipping"}class="active"{if:else}class=''''{/if}  ><a href="{path=''{embed:template_group}/{exp:cartthrob:view_setting store_checkout_page=''yes''}''}"><i class="icon-barcode icon-white" ></i> Checkout</a>\n          </li>\n		{if logged_out}\n		<li  {if segment_2=="register"}class="active"{if:else}class=''''{/if} ><a href="{path=''member/register''}"><i class="icon-user icon-white" ></i> Create an Account</a>\n        </li>\n		<li  {if segment_2=="login"}class="active"{if:else}class=''''{/if} ><a href="#login" role="button" data-toggle="modal" id="login_loader"><i class="icon-ok icon-white" ></i> Login</a>\n          </li>\n		{/if}\n		{if logged_in}\n		<li  {if segment_2=="account"}class="active"{if:else}class=''''{/if} ><a href="{path=''{embed:template_group}/account''}"><i class="icon-user icon-white" ></i> Welcome {screen_name}</a>\n        </li>\n		<li class=''''><a href="{path=''LOGOUT''}"><i class="icon-remove icon-white" ></i> Logout</a>\n          </li>\n		{/if}\n        </ul>\n      </div>\n    </div>\n  </div>\n</div>\n \n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(29, 1, 1, '_subhead', 'y', 'webpage', '<!-- Subhead\n================================================== -->\n<header class="jumbotron subhead" id="overview">\n  <div class="container">\n    <h1>{exp:cartthrob:view_setting store_name=''yes''}</h1>\n    <p class="lead">{exp:cartthrob:view_setting store_description=''yes''}</p>\n  </div>\n</header>\n', '', 1416525607, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
