(32, 1, 3, 'head_open', 'y', 'webpage', '<!DOCTYPE html>\n<head>\n<meta charset="utf-8">\n<meta name="viewport" content="width=device-width, initial-scale=1.0">\n<meta name="author" content="LiveShop" />\n<title>{title} | {site_name}</title>\n<meta name="description" content="{embed:description}" />\n<meta name="keywords" content="{embed:keywords}" />\n<!-- Default CSS -->\n<link rel="stylesheet" type="text/css" href="{skin_url}/css/bootstrap.min.css" media="screen" />\n<link rel="stylesheet" type="text/css" href="{skin_url}/css/qk.css" media="screen" />\n<link rel="stylesheet" type="text/css" href="{skin_url}/css/style2.css" media="screen" />\n<!-- Default CSS -->\n\n<!-- Theme Default CSS -->\n<link rel="stylesheet prefetch" type="text/css" href="{skin_url}/css/iconmoon.css" media="screen" />\n<!-- Theme Default CSS -->\n\n<script src="{skin_url}/js/jquery-1.7.2.js"></script>\n</head>\n<body>', '', 1416528586, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
