(50, 1, 4, 'showcase_auto', 'y', 'webpage', '<script type="text/javascript">\r\n$(function() {\r\n	$(".most_viewed").jCarouselLite({	\r\n		hoverPause:true,\r\n		visible: 3,\r\n		auto:1500,\r\n		speed:1000,\r\n		width:650\r\n		\r\n	});\r\n});\r\n</script>\r\n<div class="wg-container br-yw mb30">\r\n<div class="wg-head  bg-yw">\r\n<h2>Latest Buying Leads</h2>\r\nWhat Buyers are looking for?\r\n</div>\r\n    <div class="wg-body p10">    \r\n        <div class="leads most_viewed">\r\n		<ul>\r\n            \r\n            \r\n			\r\n            <li>\r\n				<div class="thumbnail">\r\n				<a href="#"><img src="/theme/test/skin/images/newarrivals1.jpg" /></a>\r\n				</div>\r\n				<div class="info">\r\n					<a href="http://www.vladstudio.com/wallpaper/?family_of_colors">The Family of Colors</a>\r\n					<span class="cat">Category: Creatures</span>\r\n				</div>\r\n				<div class="clear"></div>\r\n			</li>\r\n            \r\n            \r\n            \r\n			\r\n            <li>\r\n				<div class="thumbnail">\r\n				<a href="#"><img src="/theme/test/skin/images/newarrivals2.jpg" /></a>\r\n                <div class="info">\r\n					<a href="http://www.vladstudio.com/wallpaper/?family_of_colors">The Family of Colors</a>\r\n					<span class="cat">Category: Creatures</span>\r\n				</div>\r\n				</div>\r\n				\r\n				<div class="clear"></div>\r\n			</li>\r\n			\r\n            <li>\r\n				<div class="thumbnail">\r\n				<a href="#"><img src="/theme/test/skin/images/newarrivals3.jpg" /></a>\r\n                <div class="info">\r\n					<a href="http://www.vladstudio.com/wallpaper/?family_of_colors">The Family of Colors</a>\r\n					<span class="cat">Category: Creatures</span>\r\n				</div>\r\n				</div>\r\n				\r\n				<div class="clear"></div>\r\n			</li>\r\n            <li>\r\n				<div class="thumbnail">\r\n				<a href="#"><img src="/theme/test/skin/images/newarrivals4.jpg" /></a>\r\n                <div class="info">\r\n					<a href="http://www.vladstudio.com/wallpaper/?teddybear_ma