(51, 1, 4, 'quick_register', 'y', 'webpage', '<div class="wg-container br-bl mb30">\r\n<div class="wg-head  bg-bl p10 pt20">\r\n<h2 style="color:#fff !important">Quick Register</h2>\r\n<span style="color:#fff !important; font-size:12px;">Not a member yet? Creat your <strong>FREE account</strong> and start listing your business</span>\r\n</div>\r\n    <div class="wg-body p10">    \r\n        <div class="mt10">\r\n        <label>Full Name</label>\r\n        <input value="" name="first_name" type="text">\r\n        </div>\r\n        \r\n        <div class="mt10">\r\n        <label>Email Address</label>\r\n        <input value="" name="first_name" type="text">\r\n        </div>\r\n        \r\n        <div class="mt10">\r\n        <label>Phone Number</label>\r\n        <input value="" name="first_name" type="text">\r\n        </div>   \r\n        \r\n        <div class="mt20 tac">\r\n        <input class="btn btn-blue btn-pad ropa" value="Create Account" type="submit">\r\n        </div> \r\n    </div>\r\n</div>', NULL, 1416614950, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n');
