(52, 1, 4, 'm_f_wholesale_request', 'y', 'webpage', '<div class="p10">\r\n<h2>Looking to buy in bulk quantity?</h2>\r\n<p class="mt5">We provide special prices for bulk purchase. Request access to Wholesalers Area.</p>\r\n<button type="button" class="btn btn-success" data-toggle="modal" data-target="#m_f_wholesale_request">\r\nRequest Access to Wholesale Area\r\n</button>\r\n</div>\r\n\r\n\r\n\r\n<!-- Modal -->\r\n<div class="modal fade" id="m_f_wholesale_request" tabindex="-1" role="dialog" aria-labelledby="m_f_wholesale_requestLabel" aria-hidden="true">\r\n  <div class="modal-dialog">\r\n    <div class="modal-content">\r\n      <div class="modal-header">\r\n        <button type="button" class="close" data-dismiss="modal"><span aria-hidden="true">&times;</span><span class="sr-only">Close</span></button>\r\n        <h4 class="modal-title" id="m_f_wholesale_requestLabel">Modal title</h4>\r\n      </div>\r\n      <div class="modal-body">\r\n      \r\n\r\n<form id="signInForm" class="form-horizontal"\r\n    data-bv-feedbackicons-valid="glyphicon glyphicon-ok"\r\n    data-bv-feedbackicons-invalid="glyphicon glyphicon-remove"\r\n    data-bv-feedbackicons-validating="glyphicon glyphicon-refresh">\r\n\r\n    <div class="form-group">\r\n        <label class="col-xs-12">Email Address</label>\r\n        <div class="col-xs-12">\r\n            <input type="text" class="form-control" name="email"\r\n                required\r\n                data-bv-notempty-message="Email address is required" />\r\n        </div>\r\n    </div>\r\n\r\n    <div class="form-group">\r\n        <label class="col-xs-12">Mobile Number</label>\r\n        <div class="col-xs-12">\r\n            <input type="text" class="form-control" name="phone"\r\n                required\r\n                data-bv-notempty-message="Phone Number is required"                 \r\n                data-bv-numeric="true"\r\n                data-bv-numeric-message ="Phone Number is not a valid number"\r\n                maxlength="10"\r\n                minlength="10"\r\n                data-bv-stringlength-min="Phone Number has to be 10 Digits"\r\n                 />\r\n        </div>\r\n    </div>\r\n\r\n    <div class="form-group">\r\n        <div class="col-xs-12">\r\n            <button type="submit" class="btn btn-default">Sign in</button>\r\n        </div>\r\n    </div>\r\n</form>\r\n      </div>\r\n     \r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n', NULL, 1416655223, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
