(54, 1, 4, 'minicart', 'y', 'webpage', '\r\n            <ul class="nav navbar-nav navbar-right">\r\n              <li class="dropdown">\r\n                <a href="#" class="dropdown-toggle" data-toggle="dropdown" role="button" aria-expanded="false"><i class="icon i-cart"></i>Shopping Cart (0) <span class="caret"></span></a>\r\n                <ul class="dropdown-menu cart" role="menu">\r\n                  <li><a href="{site_url}login"><i class="icon i-arrow-right"></i> Login</a></li>\r\n                  <li><a href="{site_url}register"><i class="icon i-gear"></i> Register</a></li>\r\n               \r\n                  <li class="divider"></li>\r\n                  <li><a href="{site_url}view-cart"><i class="icon i-cart"></i> Shopping Cart</a><li>\r\n                  <li><a href="{site_url}checkout"><i class="icon i-coin"></i> Checkout</a></li>\r\n                  \r\n                </ul>\r\n              </li>\r\n            </ul>', NULL, 1416662321, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(55, 1, 4, 'quick_register_BACKUP', 'y', 'webpage', '\r\n\r\n<div class="wg-container p20 mb20">\r\n<div class="wg-head">\r\n<h2>Wholesaler''s Benefits (Bulk Purchase)</h2>\r\n</div>\r\n<p style="font-size:13px; color:#333" class="mt5 p5"><strong>GOOD NEWS!</strong> to Wholesalers, {site_name} provides special prices to our wholesalers. Register below to request access to wholesale area now.</p>\r\n\r\n\r\n\r\n</div>\r\n<div class="clearfix"></div>\r\n\r\n<!-- Button trigger modal -->\r\n<button type="button" class="btn btn-primary btn-lg" data-toggle="modal" data-target="#myModal">\r\n  Launch demo modal\r\n</button>\r\n\r\n<!-- Modal -->\r\n<div class="modal fade" id="myModal" tabindex="-1" role="dialog" aria-labelledby="myModalLabel" aria-hidden="true">\r\n  <div class="modal-dialog">\r\n    <div class="modal-content">\r\n      <div class="modal-header">\r\n        <button type="button" class="close" data-dismiss="modal"><span aria-hidden="true">&times;</span><span class="sr-only">Close</span></button>\r\n        <h4 class="modal-title" id="myModalLabel">Modal title</h4>\r\n      </div>\r\n      <div class="modal-body">\r\n      \r\n\r\n<form id="signInForm" class="form-horizontal"\r\n    data-bv-feedbackicons-valid="glyphicon glyphicon-ok"\r\n    data-bv-feedbackicons-invalid="glyphicon glyphicon-remove"\r\n    data-bv-feedbackicons-validating="glyphicon glyphicon-refresh">\r\n\r\n    <div class="form-group">\r\n        <label class="col-xs-12">Email Address</label>\r\n        <div class="col-xs-12">\r\n            <input type="text" class="form-control" name="email"\r\n                required\r\n                data-bv-notempty-message="Email address is required" />\r\n        </div>\r\n    </div>\r\n\r\n    <div class="form-group">\r\n        <label class="col-xs-12">Mobile Number</label>\r\n        <div class="col-xs-12">\r\n            <input type="text" class="form-control" name="phone"\r\n                required\r\n                data-bv-notempty-message="Phone Number is required"                 \r\n                data-bv-numeric="true"\r\n                data-bv-numeric-message ="Phone Number is not a valid number"\r\n                maxlength="10"\r\n                minlength="10"\r\n                data-bv-stringlength-min="Phone Number has to be 10 Digits"\r\n                 />\r\n        </div>\r\n    </div>\r\n\r\n    <div class="form-group">\r\n        <div class="col-xs-12">\r\n            <button type="submit" class="btn btn-default">Sign in</button>\r\n        </div>\r\n    </div>\r\n</form>\r\n      </div>\r\n      <div class="modal-footer">\r\n        <button type="button" class="btn btn-default" data-dismiss="modal">Close</button>\r\n        <button type="button" class="btn btn-primary">Save changes</button>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n<script>\r\n   \r\n\r\n$(document).ready(function() {\r\n	$(''#myModal'').modal(''show'');\r\n	\r\n    $(''#signInForm'').bootstrapValidator({\r\n	    feedbackIcons: {\r\n            valid: ''glyphicon glyphicon-ok'',\r\n            invalid: ''glyphicon glyphicon-remove'',\r\n            validating: ''glyphicon glyphicon-refresh''\r\n        },\r\n\r\n	// email is required\r\n	   fields: {\r\n            email: {\r\n                validators: {\r\n                    emailAddress: {\r\n                        message: ''The value is not a valid email address''\r\n                    }\r\n                }\r\n            }\r\n        }\r\n   // phone numeric and 10 digits only\r\n				\r\n		\r\n		\r\n	});\r\n});\r\n\r\n\r\n\r\n</script>\r\n\r\n\r\n\r\n\r\n\r\n', NULL, 1416664046, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
