(58, 1, 4, 'breadcrumbs', 'y', 'webpage', '<div class="container">\n<div class="row">    	\n        <div id="bc2" class="btn-group btn-breadcrumb">\n            <a href="#" class="btn btn-default"><i class="icon i-home-2" style="font-size:12px;"></i></a>            \n            <a href="#" class="btn btn-default"><div>label 1.</div></a>\n            <a href="#" class="btn btn-default"><div>label 2</div></a>\n            <a href="#" class="btn btn-default"><div>label 3</div></a>\n            <a href="#" class="btn btn-default"><div>label 4</div></a>\n            <a href="#" class="btn btn-default"><div>label 5.</div></a>\n            <a href="#" class="btn btn-default"><div>label 6</div></a>\n            <a href="#" class="btn btn-default"><div>label 7</div></a>\n            <a href="#" class="btn btn-default"><div>label 8</div></a>\n        </div>\n</div>\n</div>', '', 1416792050, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(59, 1, 4, 'connect-with-us', 'y', 'webpage', '<h2>Connect With Us</h2>\r\n  \r\n   {if "{exp:siteconfig:get item=''facebook_url''}" != ""}\r\n                        <a class="sbtnf sbtnf-circle sbtnf-icon-white sbtnf-icon-bg-black icon-facebook" target="_blank" href="{exp:siteconfig:get item=''facebook_url''}">facebook</a>\r\n                        {/if}\r\n                        \r\n                        \r\n                        {if "{exp:siteconfig:get item=''twitter_url''}" != ""}\r\n                        <a class="sbtnf sbtnf-circle sbtnf-icon-white sbtnf-icon-bg-black icon-twitter" target="_blank" href="{exp:siteconfig:get item=''twitter_url''}">twitter</a>\r\n                        {/if}\r\n\r\n\r\n						  \r\n                        {if "{exp:siteconfig:get item=''linkedin_url''}" != ""}\r\n                        <a class="sbtnf sbtnf-circle sbtnf-icon-white sbtnf-icon-bg-black icon-linkedin" target="_blank" href="{exp:siteconfig:get item=''linkedin_url''}">Linkedin</a>\r\n                        {/if}\r\n                        \r\n                        \r\n                        {if "{exp:siteconfig:get item=''pinterest_url''}" != ""}\r\n                        <a class="sbtnf sbtnf-circle sbtnf-icon-white sbtnf-icon-bg-black icon-pinterest" target="_blank" href="{exp:siteconfig:get item=''pinterest_url''}">Pinterest</a>\r\n                        {/if}\r\n                        \r\n                        \r\n                                              \r\n                        \r\n                        {if "{exp:siteconfig:get item=''picasa_url''}" != ""}\r\n                        <a class="sbtnf sbtnf-circle sbtnf-icon-white sbtnf-icon-bg-black icon-google" target="_blank" href="{exp:siteconfig:get item=''picasa_url''}">Picasa</a>\r\n                        {/if}\r\n                        \r\n                        \r\n                        \r\n 					    {if "{exp:siteconfig:get item=''youtube_url''}" != ""}\r\n                        <a class="sbtnf sbtnf-circle sbtnf-icon-white sbtnf-icon-bg-black icon-youtube" target="_blank" href="{exp:siteconfig:get item=''youtube_url''}">Youtube</a>\r\n                        {/if}\r\n                        \r\n                        \r\n                          {if "{exp:siteconfig:get item=''vimeo_url''}" != ""}\r\n                        <a class="sbtnf sbtnf-circle sbtnf-icon-white sbtnf-icon-bg-black icon-vimeo" target="_blank" href="{exp:siteconfig:get item=''vimeo_url''}">Vimeo</a>\r\n                        {/if}\r\n                                                   \r\n                            \r\n                            \r\n							<form action="#" class="searchform">\r\n								<input placeholder="Your email address" type="text">\r\n								<button type="submit" class="btn btn-default"><i class="icon i-arrow-right"></i>\r\n                                </button>\r\n								<p>Recieve latest catalogs and designs in your inbox. Signup for our newsletter now.</p>\r\n							</form>', NULL, 1416793032, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(60, 1, 4, 'company-standards', 'y', 'webpage', '<div class="our-standards" >\r\n<!-- our-standards -->\r\n <!-- Boxes de Acoes -->\r\n    	<div class="col-xs-12">\r\n			<div class="box">							\r\n				<div class="icon">\r\n					<div class="image"><i class="fa fa-thumbs-o-up"></i></div>\r\n					<div class="info">\r\n						<h3 class="title">Made with Bootstrap</h3>\r\n						<p>\r\n							Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed in lobortis nisl, vitae iaculis sapien. Phasellus ultrices gravida massa luctus ornare. Suspendisse blandit quam elit, eu imperdiet neque semper.\r\n						</p>\r\n						<div class="more">\r\n							<a href="#" title="Title Link">\r\n								Read More <i class="fa fa-angle-double-right"></i>\r\n							</a>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<div class="space"></div>\r\n			</div> \r\n		</div>\r\n			\r\n        <div class="col-xs-12">\r\n			<div class="box">							\r\n				<div class="icon">\r\n					<div class="image"><i class="fa fa-flag"></i></div>\r\n					<div class="info">\r\n						<h3 class="title">Icons by Font Awesome</h3>\r\n    					<p>\r\n							Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed in lobortis nisl, vitae iaculis sapien. Phasellus ultrices gravida massa luctus ornare. Suspendisse blandit quam elit, eu imperdiet neque semper.\r\n						</p>\r\n						<div class="more">\r\n							<a href="#" title="Title Link">\r\n								Read More <i class="fa fa-angle-double-right"></i>\r\n							</a>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<div class="space"></div>\r\n			</div> \r\n		</div>\r\n			\r\n        <div class="col-xs-12">\r\n			<div class="box">							\r\n				<div class="icon">\r\n					<div class="image"><i class="fa fa-desktop"></i></div>\r\n					<div class="info">\r\n						<h3 class="title">Desktop Friendly</h3>\r\n    					<p>\r\n							Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed in lobortis nisl, vitae iaculis sapien. Phasellus ultrices gravida massa luctus ornare. Suspendisse blandit quam elit, eu imperdiet neque semper.\r\n						</p>\r\n						<div class="more">\r\n							<a href="#" title="Title Link">\r\n								Read More <i class="fa fa-angle-double-right"></i>\r\n							</a>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<div class="space"></div>\r\n			</div> \r\n		</div>		    \r\n		<!-- /Boxes de Acoes -->\r\n\r\n<style>\r\n@import "//netdna.bootstrapcdn.com/font-awesome/4.0.3/css/font-awesome.min.css";\r\n@import "http://fonts.googleapis.com/css?family=Roboto:400,500";\r\n\r\n.box > .icon { text-align: center; position: relative; }\r\n.box > .icon > .image { position: relative; z-index: 2; margin: auto; width: 88px; height: 88px; border: 8px solid white; line-height: 88px; border-radius: 50%; background: #63B76C; vertical-align: middle; }\r\n.box > .icon:hover > .image { background: #333; }\r\n.box > .icon > .image > i { font-size: 36px !important; color: #fff !important; }\r\n.box > .icon:hover > .image > i { color: white !important; }\r\n.box > .icon > .info { margin-top: -24px; background: rgba(0, 0, 0, 0.04); border: 1px solid #e0e0e0; padding: 15px 0 10px 0; }\r\n.box > .icon:hover > .info { background: rgba(0, 0, 0, 0.04); border-color: #e0e0e0; color: white; }\r\n.box > .icon > .info > h3.title { font-family: "Roboto",sans-serif !important; font-size: 16px; color: #222; font-weight: 500; }\r\n.box > .icon > .info > p { font-family: "Roboto",sans-serif !important; font-size: 13px; color: #666; line-height: 1.5em; margin: 20px;}\r\n.box > .icon:hover > .info > h3.title, .box > .icon:hover > .info > p, .box > .icon:hover > .info > .more > a { color: #222; }\r\n.box > .icon > .info > .more a { font-family: "Roboto",sans-serif !important; font-size: 12px; color: #222; line-height: 12px; text-transform: uppercase; text-decoration: none; }\r\n.box > .icon:hover > .info > .more > a { color: #fff; padding: 6px 8px; background-color: #63B76C; }\r\n.box .space { height: 30px; }\r\n</style>\r\n<!-- our-standards -->\r\n</div>', NULL, 1416793199, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
