(101, 1, 4, 'm_loginform', 'y', 'webpage', '<div class="modal fade" id="loginform" tabindex="-1" role="dialog" aria-labelledby="loginformLabel" aria-hidden="true">\r\n  <div class="modal-dialog">\r\n    <div class="modal-content">\r\n      <div class="modal-header">\r\n        <button type="button" class="close" data-dismiss="modal"><span aria-hidden="true">&times;</span><span class="sr-only">Close</span></button>\r\n        <h4 class="modal-title" id="loginformLabel">Request Wholesale Access</h4>\r\n        <p>I would like to gain access to wholesale area special prices and catalogs</p>\r\n      </div>\r\n      <div class="modal-body">\r\n      \r\n\r\n<form id="signInForm" class="form-horizontal"\r\n    data-bv-feedbackicons-valid="glyphicon glyphicon-ok"\r\n    data-bv-feedbackicons-invalid="glyphicon glyphicon-remove"\r\n    data-bv-feedbackicons-validating="glyphicon glyphicon-refresh">\r\n\r\n    <div class="form-group">\r\n        <label class="col-xs-12">Email Address</label>\r\n        <div class="col-xs-12">\r\n            <input type="text" class="form-control" name="email"\r\n                required\r\n                data-bv-notempty-message="Email address is required" />\r\n        </div>\r\n    </div>\r\n\r\n    <div class="form-group">\r\n        <label class="col-xs-12">Mobile Number</label>\r\n        <div class="col-xs-12">\r\n            <input type="text" class="form-control" name="phone"\r\n                required\r\n                data-bv-notempty-message="Phone Number is required"                 \r\n                data-bv-numeric="true"\r\n                data-bv-numeric-message ="Phone Number is not a valid number"\r\n                maxlength="10"\r\n                minlength="10"\r\n                data-bv-stringlength-min="Phone Number has to be 10 Digits"\r\n                 />\r\n        </div>\r\n    </div>\r\n\r\n    <div class="form-group">\r\n        <div class="col-xs-12">\r\n            <button type="submit" class="btn btn-default">Sign in</button>\r\n        </div>\r\n    </div>\r\n</form>\r\n      </div>\r\n     \r\n    </div>\r\n  </div>\r\n</div>', NULL, 1417600116, 1, 'n', 0, '', 'n', 'n', 'o', 0, 'n'),
(96, 1, 2, 'shopping-cart', 'y', 'webpage', '{preload_replace:template_group="site"}\n{preload_replace:template="checkout"}\n \n{embed="{template_group}/_header" title="Shopping Cart" template_group="{template_group}" template="{template}" }\n \n</head>\n<body>\n	<div id="container">\n		<div id="main">\n			{embed="{template_group}/_store_header" template_group="{template_group}" template="{template}"}\n 					<div class="left_column">\n						<h1>Shopping Cart</h1>\n						{if "{exp:cartthrob:total_items_count}"==0}You have no items in your cart. <a href="{path=cart/}">Continue shopping.</a>{/if}\n						{exp:cartthrob:cart_items_info}\n							{if first_row}\n					    		{exp:cartthrob:update_cart_form \n								id="update_cart_form"\n					        		return="{template_group}/{template}"}\n							{/if}\n									<div class="product">\n										<h3>{title}</h3>\n										{if product_thumbnail}\n										<a href="{entry_id_path=''{template_group}/product_detail''}"><img src="{product_thumbnail}" /></a>\n 										{/if}										\n 										<p>Price: {item_price} x {quantity} = {item_subtotal}</p>\n										{if no_tax !="1"}<p>Price including tax {item_price:plus_tax} x {quantity} = {item_subtotal:plus_tax}</p>{/if}\n										\n										{if !is_package}\n											{exp:cartthrob:item_options entry_id="{entry_id}" row_id="{row_id}" }\n\n												{item_options:list}\n													{if option_first_row}\n														<p> \n														<label>{option_label}</label>\n													{/if}  \n												{/item_options:list}\n\n												{if dynamic} \n													{item_options:input}\n												{if:else}\n												  	{item_options:select}		\n														<option {selected} value="{option_value}">{option_name} {price}</option>\n													{/item_options:select}\n												{/if}\n												 {item_options:list}\n													{if option_last_row}\n														</p> \n													{/if}  \n												{/item_options:list}\n\n											{/exp:cartthrob:item_options}\n										{/if}\n\n										<p>\n											<label for="product_quantity_{row_id}">Quantity</label>\n											<input type="text" id="product_quantity_{row_id}" name="quantity[{row_id}]" size="8"  value="{quantity}" /> \n										</p>\n										<p>\n											\n											<label for="delete_this_{row_id}">Delete this?</label> \n											<input type="checkbox" id="delete_this_{row_id}" name="delete[{row_id}]">\n										</p>\n 									</div>\n 							\n							{if last_row}\n	\n							     <input type="submit" class=''cart_submit_button'' rel="cart/view_cart" value="Update" /> \n							     <input type="submit" class=''cart_submit_button'' rel="cart/shipping" value="Proceed to Checkout" /> \n\n								{/exp:cartthrob:update_cart_form}\n							{/if}\n						{/exp:cartthrob:cart_items_info}\n							\n					</div>\n					<div class="right_column">\n					{exp:cartthrob:cart_items_info limit="1" order_by="entry_id" sort="desc"}\n 						{embed="{template_group}/_right_column" entry_id="{entry_id}" template_group="{template_group}" template="{template}"}\n					{/exp:cartthrob:cart_items_info}\n					</div>\n					<div class="clear_both"></div>\n  				{embed=cart/_footer_nav template="{template}" template_group="{template_group}"}\n', '', 1417379328, 1, 'n', 0, '', 'n', 'n', 'o', 1093, 'n'),
(97, 1, 2, 'checkout', 'y', 'webpage', '{preload_replace:template_group="cart"}\n{preload_replace:template="checkout"}\n \n{embed="{template_group}/_header" title="Checkout" template_group="{template_group}" template="{template}" }\n \n</head>\n<body>\n	<div id="container">\n		<div id="main">\n			{embed="{template_group}/_store_header" template_group="{template_group}" template="{template}"}\n 					<div class="left_column">\n						<h1>Billing Information</h1>\n						{if "{exp:cartthrob:total_items_count}" > 0}\n						\n						<div id="checkout_header">\n\n							<div id="checkout_totals">\n								<table>\n									<tr>\n										<td><span class="sale_price">Total</span></td>\n										<td><span class="sale_price"><span class="cart_total">{exp:cartthrob:cart_total}</span></span></td>\n									</tr>							\n									<tr>\n										<td>Subtotal</td>\n										<td><span class="cart_subtotal">{exp:cartthrob:cart_subtotal}</span></td>\n									</tr>\n									<tr>\n										<td>Shipping</td>\n										<td><span class="cart_shipping">{exp:cartthrob:cart_shipping}</span></td>\n									</tr>\n									<tr>\n										<td>Tax</td>\n										<td><span class="cart_tax">{exp:cartthrob:cart_tax}</span></td>\n									</tr>\n									<tr>\n										<td>Discount</td>\n										<td>-<span class="cart_discount">{exp:cartthrob:cart_discount}</span></td>\n									</tr>\n								</table>\n 							</div>\n							<div id="checkout_notes">\n								<p>Expected shipping time \n								is 3-7 days<br /><br />\n\n								*All fields are required</p>\n							</div>\n							<div class="clear_both"></div>\n						</div>\n\n						{!-- add secure_action="yes" parameter if you want to submit this form using HTTPS:// connection --}\n						{exp:cartthrob:checkout_form \n							return="{template_group}/order_info"}\n							\n							{if {exp:cartthrob:view_setting allow_gateway_selection="yes"}}\n								<p><label for="gateway">Select a payment method</label>\n								{exp:cartthrob:gateway_select id="gateway"}</p>\n							{/if}\n							\n							<div id="checkout_form_gateway_fields">\n							{gateway_fields}\n							</div>\n							\n						    <input type="submit" class="cart_submit_button" value="Complete Checkout" />\n						{/exp:cartthrob:checkout_form}\n\n\n						{if:else}\n							<p>You have no items in your cart. <a href="{path=cart/index}">Continue shopping</a></p>\n						{/if}\n					</div>\n					<div class="right_column">\n					{exp:cartthrob:cart_items_info limit="1" order_by="entry_id" sort="desc"}\n 						{embed="{template_group}/_right_column" entry_id="{entry_id}" template_group="{template_group}" template="{template}"}\n					{/exp:cartthrob:cart_items_info} 						\n						\n					</div>\n					<div class="clear_both"></div>\n  				{embed=cart/_footer_nav template="{template}" template_group="{template_group}"}\n', '', 1417379449, 1, 'n', 0, '', 'n', 'n', 'o', 886, 'n'),
